import React from 'react';

const Reports = () => {
  return (
    <div className="space-y-6">
      <div>
        <h1 className="text-2xl font-bold text-gray-900">Reports</h1>
        <p className="text-gray-600">Generate and view detailed reports</p>
      </div>
      
      <div className="card p-8 text-center">
        <h3 className="text-lg font-medium text-gray-900 mb-2">Reporting System</h3>
        <p className="text-gray-600">
          This page will provide comprehensive reporting and analytics tools.
        </p>
        <div className="mt-4 text-sm text-gray-500">
          <p>• Custom report generation</p>
          <p>• Historical trend analysis</p>
          <p>• Export functionality</p>
          <p>• Scheduled reports</p>
        </div>
      </div>
    </div>
  );
};

export default Reports;
